import React from 'react';
import ValueChanger from "./ValueChanger";
import Grid from '@mui/material/Unstable_Grid2'; // Grid version 2

function Client(props){
    let propertiesList = [

    ];
    const sendChange= (changes) => {
        props.onValueChange(changes);
    }
    for(const [property, value] of Object.entries(props.properties)){
        console.log(property + " | " + value);
        propertiesList.push(

            <Grid key={property} xs={12} sm={6} md={4}>
                <ValueChanger property={property} value={value} onValueChange={sendChange}></ValueChanger>
            </Grid>
        )
    }


    return(
        // <ul>
            //{propertiesList}
        // </ul>
        <Grid container spacing={2}>
            {propertiesList}
        </Grid>

        
    )
}

export default Client;
